import InterestService from '../services/interests.service'

class Interests {

    getInterestsKeyword = (object) => {
        try {
            var interests = object.map(a => a.keyword)
            return interests
        } catch (err) {
            console.log(err)
        }
    }

    getAllAvailableInterests = () => {
        var interest_list = [];
        InterestService.getInterestList().then(data => {
            interest_list = this.getInterestsKeyword(data.interests);
        })
        return interest_list;
    }

    alist = this.getInterestsKeyword(this.getAllAvailableInterests());

    getAvailableInterests = (array) => {

        var list = this.alist.filter(function(e) {
            return !(array.includes(e));
        });
        return list;
    }
}

export default new Interests();
